  const params = useParams();
  console.log(params.id);
  return (
    <>
      <Header />
      <StyledMain>
        <section>
          <div>
            <h2>Olá, {user.name}!</h2>
            <span>{user.course_module}</span>
          </div>
        </section>
        <section>
          <div>
            <h2>Que pena! Estamos em desenvolvimento :(</h2>
            <p>
              Nossa aplicação está em desenvolvimento, em breve teremos
              novidades
            </p>
          </div>
        </section>
      </StyledMain>
    </>
  );
};
